install_script="""\
#!/bin/bash

binpath='%s/bin'
system=`uname -s`

if [ "$system" == "Darwin" ]
then
    loginshell=`dscl . -read /Users/\`whoami\` UserShell | awk '{print $NF}'`
    parent=`"$binpath/pidname" $PPID | awk '{print $NF}'`
else
    loginshell=`getent passwd \`whoami\` | awk -F ':' '{print $NF}'`
    parent=`readlink /proc/$PPID/exe`
fi

if [[ "$parent" == *"login" ]]
then
    target=$loginshell
else
    target=$parent
fi

echo    
echo You can now use %s
echo


if [[ "$target" == *"csh" ]]
then
    activate="$binpath/activate.csh"
else
    activate="$binpath/activate"
fi

    $target -c "source \\"$activate\\"; $target"

echo    
echo %s are no more activated, Bye...
echo

"""

local_pip=[]


import base64
import os.path
import shutil
import sys
import tempfile
import urllib2
